import React, { useState } from 'react';
import './components.css';
import { navBar as NavBar } from './header';
import { Row, Col } from 'react-bootstrap';

export default function Story(props) {
  return (
    <div>
      <NavBar />
      <Col lg={4} md={6} sm={12} className="page">
        <h1>Heading</h1>
	<div>Description</div>
	<Row className="page-details">
	  <Col className="page-author">Author</Col>
	  <Col className="page-date">Date posted</Col>
	  <Col className="page-stats">
	    <Col className="page-likes"></Col>
	    <Col className="page-comments"></Col>
	  </Col>
	</Row>
      </Col>
    </div>
  );
}
